import React from 'react';

const Edit = ({ singleuser }) => {

    return(
        <div>
            <div>
                <label> Username</label>
                <input id='newusername' type='text' placeholder={`${singleuser.name}`} />
                <input id='submitnewusername' type='button' value='Update Name' />
            </div>
        </div>
    )
}

export default Edit;
